import React, { useEffect } from 'react'
import { getProfile } from '../actions/auth'

const Dashboard = () => {
  useEffect(() => {
    const token = localStorage.getItem('access_token')
    if (!token) {
      window.location.href = '/'
    }
    (async () => {
      const profile = await getProfile();
    })()
  }, [])
  return (
    <div>Dashboard</div>
  )
}

export default Dashboard
